INSERT INTO `COMMUNITY_PAGES_MAPPING` VALUES (8, '10', 'MTONGUE', 'Hindi-Delhi', '20', 'Bania', 'CASTE', 'Y', '/hindi-delhi-bania-matrimony-matrimonials', 'L2_MT_8', 'Bania Hindus are the caste of Hindus and are at the third highest position among the Hindu castes in India. In most of the cases, communities from the social order of Vaishyas of the caste system of India are popularly known as Bania Hindus. While in some other cases, Bania is used to refer as an occupational term, which denotes the people hailing from the business class and other trading areas. Delhi Bania Hindus consist of the people with surnames like Agarwal, Kasuadhan, Khandelwal, etc. ', 'Hindi-Delhi Bania Matrimony - Hindi-Delhi Bania Matrimonial - Hindi-Delhi Bania Matrimonials -Hindi-Delhi Bania Marriage - Online Hindi-Delhi Bania Matrimonials - Matrimonial Services', 'Search Hindi-Delhi Bania Matrimony, Hindi-Delhi Bania Matrimonial, Hindi-Delhi Bania Matrimonials, Hindi-Delhi Bania Marriage, Hindi-Delhi Bania Matrimonial Profiles in the leading Hindi-Delhi Bania Matrimonials site for Indian and NRI Hindi-Delhi Bania Marriage. Join Free &amp; Add your Hindi-Delhi Bania Matrimonial Profile Now! Find suitable Indian &amp; NRI Hindi-Delhi Bania brides and grooms from our online Hindi-Delhi Bania matrimonial and matchmaking services.', 'Hindi-Delhi Bania matrimony, Hindi-Delhi Bania matrimonials, Hindi-Delhi Bania matrimonial, online Hindi-Delhi Bania matrimonials, Hindi-Delhi Bania profiles, Hindi-Delhi Bania matchmaking services, Hindi-Delhi Bania bride, Hindi-Delhi Bania groom,  matrimonials, matrimony, matrimony services, Indian marriage, match making, matchmaker, marriage bureau , matchmaking services, matrimonial profiles, matrimony classified, brides, grooms', 'Hindi-Delhi Bania Matrimonials', 'Y', 'hindi-delhi-matrimonials.jpg', 'hindi-delhi-bania matrimony');
