INSERT INTO `COMMUNITY_PAGES_MAPPING` VALUES (51, '33', 'MTONGUE', 'Hindi-UP', '1', 'Hindu', 'RELIGION', 'Y', '/hindi-up-hindu-matrimony-matrimonials', 'L2_MT_51', 'Uttar Pradesh has been an ancient seat of Hindu religion, learning and culture. Hindus constitute nearly 80% of the population in the state and Hindi is the official language. It has many important sites of Hindu pilgrimage including the holy cities of Varanasi, Ayodhya, Mathura, Vrindavan and Allahabad. \n\nBanarasi saris from Varanasi in UP are an essential part of any Hindu marriage in the state. The most important Hindu festivals in UP are Diwali, Holi and Dussehra celebrated with great fervor. \n', 'Hindi-UP Hindu Matrimony - Hindi-UP Hindu Matrimonial - Hindi-UP Hindu Matrimonials -Hindi-UP Hindu Marriage - Online Hindi-UP Hindu Matrimonials - Matrimonial Services', 'Search Hindi-UP Hindu Matrimony, Hindi-UP Hindu Matrimonial, Hindi-UP Hindu Matrimonials, Hindi-UP Hindu Marriage, Hindi-UP Hindu Matrimonial Profiles in the leading Hindi-UP Hindu Matrimonials site for Indian and NRI Hindi-UP Hindu Marriage. Join Free &amp; Add your Hindi-UP Hindu Matrimonial Profile Now! Find suitable Indian &amp; NRI Hindi-UP Hindu brides and grooms from our online Hindi-UP Hindu matrimonial and matchmaking services.', 'Hindi-UP Hindu matrimony, Hindi-UP Hindu matrimonials, Hindi-UP Hindu matrimonial, online Hindi-UP Hindu matrimonials, Hindi-UP Hindu profiles, Hindi-UP Hindu matchmaking services, Hindi-UP Hindu bride, Hindi-UP Hindu groom,  matrimonials, matrimony, matrimony services, Indian marriage, match making, matchmaker, marriage bureau , matchmaking services, matrimonial profiles, matrimony classified, brides, grooms', 'Hindi-UP Hindu Matrimonials', 'Y', 'hindi-up-matrimonials.jpg', 'hindi-up-hindu matrimony');
