INSERT INTO `COMMUNITY_PAGES_MAPPING` VALUES (196, '17', 'MTONGUE', 'Malayalee', '1', 'Hindu', 'RELIGION', 'Y', '/malayalee-hindu-matrimony-matrimonials', 'L2_MT_196', 'The Malayali people are a group of people who speak Malayalam, originating from the Indian state of Kerala often called Keralites. \n\nSome of the Malayalee Hindu communities are:\n-Samanta or Malayala Kshatriya; \n-Nambudiri Brahmins, the indigenous Brahmins of Kerala; \n-Nairs, the second largest Hindu community in Kerala; \n-Ambalavasi, composed of a number of Hindu castes; \n-Ezhavas or Thiyyas, the largest Hindu community in Kerala and \n-Pulayas or Pulayar, among the main social groups found in Kerala.\n', 'Malayalee Hindu Matrimony - Malayalee Hindu Matrimonial - Malayalee Hindu Matrimonials -Malayalee Hindu Marriage - Online Malayalee Hindu Matrimonials - Matrimonial Services', 'Search Malayalee Hindu Matrimony, Malayalee Hindu Matrimonial, Malayalee Hindu Matrimonials, Malayalee Hindu Marriage, Malayalee Hindu Matrimonial Profiles in the leading Malayalee Hindu Matrimonials site for Indian and NRI Malayalee Hindu Marriage. Join Free &amp; Add your Malayalee Hindu Matrimonial Profile Now! Find suitable Indian &amp; NRI Malayalee Hindu brides and grooms from our online Malayalee Hindu matrimonial and matchmaking services.', 'Malayalee Hindu matrimony, Malayalee Hindu matrimonials, Malayalee Hindu matrimonial, online Malayalee Hindu matrimonials, Malayalee Hindu profiles, Malayalee Hindu matchmaking services, Malayalee Hindu bride, Malayalee Hindu groom,  matrimonials, matrimony, matrimony services, Indian marriage, match making, matchmaker, marriage bureau , matchmaking services, matrimonial profiles, matrimony classified, brides, grooms', 'Malayalee Hindu Matrimonials', 'Y', 'malayalee-matrimonials.jpg', 'malayalee-hindu matrimony');
