INSERT INTO `COMMUNITY_PAGES_MAPPING` VALUES (269, '7', 'MTONGUE', 'Bihari', '1', 'Hindu', 'RELIGION', 'Y', '/bihari-hindu-matrimony-matrimonials', 'L2_MT_269', 'Bihari Hindus are the people living in the Bihar state of India and who practice Hinduism as their religion. Bihari Hindus, other than living in Bihar, can be found settled in the areas of Uttar Pradesh, Nepal, West Bengal and Jharkhand. Bhojpuri, Maithili, Hindi and Magahi are few of the languages spoken by Bihari Hindus. The castes and sub castes of Bihari Hindus like Hindus- Brahmin, Yadav, Rajput, Kurmi, Bhumihar, Banias, and Kayastha are well represented in Bihar and other adjoining states. ', 'Bihari Hindu Matrimony - Bihari Hindu Matrimonial - Bihari Hindu Matrimonials -Bihari Hindu Marriage - Online Bihari Hindu Matrimonials - Matrimonial Services', 'Search Bihari Hindu Matrimony, Bihari Hindu Matrimonial, Bihari Hindu Matrimonials, Bihari Hindu Marriage, Bihari Hindu Matrimonial Profiles in the leading Bihari Hindu Matrimonials site for Indian and NRI Bihari Hindu Marriage. Join Free &amp; Add your Bihari Hindu Matrimonial Profile Now! Find suitable Indian &amp; NRI Bihari Hindu brides and grooms from our online Bihari Hindu matrimonial and matchmaking services.', 'Bihari Hindu matrimony, Bihari Hindu matrimonials, Bihari Hindu matrimonial, online Bihari Hindu matrimonials, Bihari Hindu profiles, Bihari Hindu matchmaking services, Bihari Hindu bride, Bihari Hindu groom,  matrimonials, matrimony, matrimony services, Indian marriage, match making, matchmaker, marriage bureau , matchmaking services, matrimonial profiles, matrimony classified, brides, grooms', 'Bihari Hindu Matrimonials', 'Y', 'bihari-matrimonials.jpg', 'bihari-hindu matrimony');
