INSERT INTO `COMMUNITY_PAGES_MAPPING` VALUES (364, '34', 'MTONGUE', 'Konkani', '3', 'Christian', 'RELIGION', 'Y', '/konkani-christian-matrimony-matrimonials', 'L2_MT_364', 'Konkani people belong to Konkan coast of western India speaking the indo-Aryan language known as Konkani. They are mainly settled in Goa, Mangalore and few pockets of Maharashtra region and are highly educated. \nChristians form a major group among Konkaniâ€™s. The maximum population of Konkani christians is located in Goa and Mangalore. Velhas Comquistas are believed to be the first converted Christians and ancestors having Portuguese surnames although their first names are usually Hindu names.  \n', 'Konkani Christian Matrimony - Konkani Christian Matrimonial - Konkani Christian Matrimonials -Konkani Christian Marriage - Online Konkani Christian Matrimonials - Matrimonial Services', 'Search Konkani Christian Matrimony, Konkani Christian Matrimonial, Konkani Christian Matrimonials, Konkani Christian Marriage, Konkani Christian Matrimonial Profiles in the leading Konkani Christian Matrimonials site for Indian and NRI Konkani Christian Marriage. Join Free &amp; Add your Konkani Christian Matrimonial Profile Now! Find suitable Indian &amp; NRI Konkani Christian brides and grooms from our online Konkani Christian matrimonial and matchmaking services.', 'Konkani Christian matrimony, Konkani Christian matrimonials, Konkani Christian matrimonial, online Konkani Christian matrimonials, Konkani Christian profiles, Konkani Christian matchmaking services, Konkani Christian bride, Konkani Christian groom,  matrimonials, matrimony, matrimony services, Indian marriage, match making, matchmaker, marriage bureau , matchmaking services, matrimonial profiles, matrimony classified, brides, grooms', 'Konkani Christian Matrimonials', 'Y', 'konkani-matrimonials.jpg', 'konkani-christian matrimony');
