INSERT INTO `COMMUNITY_PAGES_MAPPING` VALUES (504, '25', 'CASTE', 'Brahmin', '33', 'Brahmin Gaur', 'CASTE', 'Y', '/matrimonials/gaur-matrimonial/', 'L2_CA_504', 'Brahmin Gaurs, residents of North- India, are the sub- caste of Brahmin. Haryana is the place, where most of the Hindu Brahmin Gaurs have their habitat, but they are originally from Bengal. They are the people, with surnames like Sharma, Bharadwaj, Tiwari, Pathik, Sandali, Tandra, Kapil, etc. Brahmin Gaurs are basically Vaishnavi Hindus, who worship almost all the gods and goddesses of Hindu religion. Saharanpur and Haridwar, are two main districts, in which the Brahmin Gaurs are divided in UP. ', 'Gaur Matrimony - Gaur Matrimonial - Gaur Matrimonials -Gaur Marriage - Online Gaur Matrimonials - Matrimonial Services', 'Search Gaur Matrimony, Gaur Matrimonial, Gaur Matrimonials, Gaur Marriage, Gaur Matrimonial Profiles in the leading Gaur Matrimonials site for Indian and NRI Gaur Marriage. Join Free &amp; Add your Gaur Matrimonial Profile Now! Find suitable Indian &amp; NRI Gaur brides and grooms from our online Gaur matrimonial and matchmaking services.', 'Gaur matrimony, Gaur matrimonials, Gaur matrimonial, online Gaur matrimonials, Gaur profiles, Gaur matchmaking services, Gaur bride, Gaur groom,  matrimonials, matrimony, matrimony services, Indian marriage, match making, matchmaker, marriage bureau , matchmaking services, matrimonial profiles, matrimony classified, brides, grooms', 'Gaur Matrimonials', 'Y', 'brahmin-matrimonials.jpg', 'gaur matrimony');
INSERT INTO `COMMUNITY_PAGES_MAPPING` VALUES (505, '25', 'CASTE', 'Brahmin', '36', 'Brahmin Kanyakubj', 'CASTE', 'Y', '/matrimonials/kanyakubj-matrimonial/', 'L2_CA_505', 'Brahmin Kanyakubj belongs to Hindu Brahmin community, residing in the central part of the country. The community refers to the people belonging to the Kannauj region and are the direct descendents of the lord Parshuram and Rishi Bhardwaj. Kanyakubj Brahmins used to follow the profession of landlords in the regions of Kannauj, Bhojpuri regions of Madhya Pradesh, Chattisgarh, and Jharkhand, at the times of colonial rule. Also, most of them had large kingdoms in the times of Pushyamitra Shung.', 'Kanyakubj Matrimony - Kanyakubj Matrimonial - Kanyakubj Matrimonials -Kanyakubj Marriage - Online Kanyakubj Matrimonials - Matrimonial Services', 'Search Kanyakubj Matrimony, Kanyakubj Matrimonial, Kanyakubj Matrimonials, Kanyakubj Marriage, Kanyakubj Matrimonial Profiles in the leading Kanyakubj Matrimonials site for Indian and NRI Kanyakubj Marriage. Join Free &amp; Add your Kanyakubj Matrimonial Profile Now! Find suitable Indian &amp; NRI Kanyakubj brides and grooms from our online Kanyakubj matrimonial and matchmaking services.', 'Kanyakubj matrimony, Kanyakubj matrimonials, Kanyakubj matrimonial, online Kanyakubj matrimonials, Kanyakubj profiles, Kanyakubj matchmaking services, Kanyakubj bride, Kanyakubj groom,  matrimonials, matrimony, matrimony services, Indian marriage, match making, matchmaker, marriage bureau , matchmaking services, matrimonial profiles, matrimony classified, brides, grooms', 'Kanyakubj Matrimonials', 'Y', 'brahmin-matrimonials.jpg', 'kanyakubj matrimony');
INSERT INTO `COMMUNITY_PAGES_MAPPING` VALUES (506, '25', 'CASTE', 'Brahmin', '28', 'Brahmin Bhumihar', 'CASTE', 'Y', '/matrimonials/brahmin-bhumihar-matrimonial/', 'L2_CA_506', 'Bhumihar or Babhan or Bhuin-har is a community mainly found in the Indian states of Bihar, Jharkhand, Uttar Pradesh and parts of Madhya Pradesh. Some classify Bhumihars in the Brahmin varna of Hinduism but this claim has been refuted by some. \n\nBhumihars are commonly called Babhans which is the Pali word for Brahmins and is used to refer to Brahmins in Buddhist sources. The Bhumihar Brahmins follow in every respect the standard Brahminical rules and are endogamous like all other Brahmins. \n\n', 'Bhumihar Matrimony - Bhumihar Matrimonial - Bhumihar Matrimonials -Bhumihar Marriage - Online Bhumihar Matrimonials - Matrimonial Services', 'Search Bhumihar Matrimony, Bhumihar Matrimonial, Bhumihar Matrimonials, Bhumihar Marriage, Bhumihar Matrimonial Profiles in the leading Bhumihar Matrimonials site for Indian and NRI Bhumihar Marriage. Join Free &amp; Add your Bhumihar Matrimonial Profile Now! Find suitable Indian &amp; NRI Bhumihar brides and grooms from our online Bhumihar matrimonial and matchmaking services.', 'Bhumihar matrimony, Bhumihar matrimonials, Bhumihar matrimonial, online Bhumihar matrimonials, Bhumihar profiles, Bhumihar matchmaking services, Bhumihar bride, Bhumihar groom,  matrimonials, matrimony, matrimony services, Indian marriage, match making, matchmaker, marriage bureau , matchmaking services, matrimonial profiles, matrimony classified, brides, grooms', 'Bhumihar Matrimonials', 'Y', 'brahmin-matrimonials.jpg', 'brahmin-bhumihar matrimony');
INSERT INTO `COMMUNITY_PAGES_MAPPING` VALUES (507, '25', 'CASTE', 'Brahmin', '30', 'Brahmin Deshastha', 'CASTE', 'Y', '/deshastha-matrimony-matrimonials', 'L2_CA_507', 'Deshastha Brahmins are the original and the oldest Hindu Brahmin sub-caste from the state of Maharashtra in India. The word Deshastha comes from Sanskrit words Desha meaning inland or country and Stha meaning resident. They together imply &quot;residents of the country&quot;.\nAs the original Brahmins of Maharashtra, they have been held in the greatest esteem and have considered themselves superior to other Brahmins. Brahmins constitute 4% of the stateâ€™s population and 60% of them are Deshastha Brahmins.\n', 'Deshastha Matrimony - Deshastha Matrimonial - Deshastha Matrimonials -Deshastha Marriage - Online Deshastha Matrimonials - Matrimonial Services', 'Search Deshastha Matrimony, Deshastha Matrimonial, Deshastha Matrimonials, Deshastha Marriage, Deshastha Matrimonial Profiles in the leading Deshastha Matrimonials site for Indian and NRI Deshastha Marriage. Join Free &amp; Add your Deshastha Matrimonial Profile Now! Find suitable Indian &amp; NRI Deshastha brides and grooms from our online Deshastha matrimonial and matchmaking services.', 'Deshastha matrimony, Deshastha matrimonials, Deshastha matrimonial, online Deshastha matrimonials, Deshastha profiles, Deshastha matchmaking services, Deshastha bride, Deshastha groom,  matrimonials, matrimony, matrimony services, Indian marriage, match making, matchmaker, marriage bureau , matchmaking services, matrimonial profiles, matrimony classified, brides, grooms', 'Deshastha Matrimonials', 'Y', 'brahmin-matrimonials.jpg', 'deshastha matrimony');
INSERT INTO `COMMUNITY_PAGES_MAPPING` VALUES (508, '25', 'CASTE', 'Brahmin', '47', 'Brahmin Saryuparin', 'CASTE', 'Y', '/matrimonials/saryuparin-matrimonial/', 'L2_CA_508', 'Saryuparin Brahmins also known as Sarvarya or Saryupariya Brahmins are North Indian Brahmins who reside on the eastern plain of the Saryu River in India. Within the Saryuparin Brahmins, most Brahmin families were involved solely in the research and analysis of Vedas and other religious texts, performing Yajnas and other religious practices. They did not perform poojas for benefactors and did not take dakshinas or donations. And so, they were seen as incorruptible and superior to other Brahmins.', 'Saryuparin Matrimony - Saryuparin Matrimonial - Saryuparin Matrimonials -Saryuparin Marriage - Online Saryuparin Matrimonials - Matrimonial Services', 'Search Saryuparin Matrimony, Saryuparin Matrimonial, Saryuparin Matrimonials, Saryuparin Marriage, Saryuparin Matrimonial Profiles in the leading Saryuparin Matrimonials site for Indian and NRI Saryuparin Marriage. Join Free &amp; Add your Saryuparin Matrimonial Profile Now! Find suitable Indian &amp; NRI Saryuparin brides and grooms from our online Saryuparin matrimonial and matchmaking services.', 'Saryuparin matrimony, Saryuparin matrimonials, Saryuparin matrimonial, online Saryuparin matrimonials, Saryuparin profiles, Saryuparin matchmaking services, Saryuparin bride, Saryuparin groom,  matrimonials, matrimony, matrimony services, Indian marriage, match making, matchmaker, marriage bureau , matchmaking services, matrimonial profiles, matrimony classified, brides, grooms', 'Saryuparin Matrimonials', 'Y', 'brahmin-matrimonials.jpg', 'saryuparin matrimony');
INSERT INTO `COMMUNITY_PAGES_MAPPING` VALUES (509, '25', 'CASTE', 'Brahmin', '66', 'Brahmin Iyer', 'CASTE', 'Y', '/matrimonials/iyer-matrimonial/', 'L2_CA_509', 'Iyer is the title given to the caste of Hindu Brahmin communities of Tamil origin. Most Iyers are followers of the Advaita philosophy propounded by Adi Shankara and the majority resides in Tamil Nadu.\n\nAccording to popular tradition, Iyers are descendants of Indo-Aryan migrants from North India. Iyers are sub-divided into various sub-sects based on cultural and regional differences. Like all Brahmins, they are also classified based on their gotra or patrilineal descent and the Veda they follow.\n', 'Iyer Matrimony - Iyer Matrimonial - Iyer Matrimonials -Iyer Marriage - Online Iyer Matrimonials - Matrimonial Services', 'Search Iyer Matrimony, Iyer Matrimonial, Iyer Matrimonials, Iyer Marriage, Iyer Matrimonial Profiles in the leading Iyer Matrimonials site for Indian and NRI Iyer Marriage. Join Free &amp; Add your Iyer Matrimonial Profile Now! Find suitable Indian &amp; NRI Iyer brides and grooms from our online Iyer matrimonial and matchmaking services.', 'Iyer matrimony, Iyer matrimonials, Iyer matrimonial, online Iyer matrimonials, Iyer profiles, Iyer matchmaking services, Iyer bride, Iyer groom,  matrimonials, matrimony, matrimony services, Indian marriage, match making, matchmaker, marriage bureau , matchmaking services, matrimonial profiles, matrimony classified, brides, grooms', 'Iyer Matrimonials', 'Y', 'brahmin-matrimonials.jpg', 'iyer matrimony');
INSERT INTO `COMMUNITY_PAGES_MAPPING` VALUES (510, '25', 'CASTE', 'Brahmin', '46', 'Brahmin Saraswat', 'CASTE', 'Y', '/matrimonials/saraswat-matrimonial/', 'L2_CA_510', 'Saraswats have descended from a Brahmin caste mentioned in ancient Hindu scriptures as inhabiting the Saraswati River valley. Around 1900 BC, the river Saraswati started vanishing under ground and the people on its banks started migrating to other parts of India thus forming sub-communities. \n\nThe sub-communities in Saraswats include: Kashimri Saraswats, Punjabi Saraswats, Sind Saraswats, Kutch Saraswats, Rajasthan Saraswats, Saraswat&#039;s from Uttranchal, those from Uttar Pradesh and from Konkan. \n', 'Saraswat Matrimony - Saraswat Matrimonial - Saraswat Matrimonials -Saraswat Marriage - Online Saraswat Matrimonials - Matrimonial Services', 'Search Saraswat Matrimony, Saraswat Matrimonial, Saraswat Matrimonials, Saraswat Marriage, Saraswat Matrimonial Profiles in the leading Saraswat Matrimonials site for Indian and NRI Saraswat Marriage. Join Free &amp; Add your Saraswat Matrimonial Profile Now! Find suitable Indian &amp; NRI Saraswat brides and grooms from our online Saraswat matrimonial and matchmaking services.', 'Saraswat matrimony, Saraswat matrimonials, Saraswat matrimonial, online Saraswat matrimonials, Saraswat profiles, Saraswat matchmaking services, Saraswat bride, Saraswat groom,  matrimonials, matrimony, matrimony services, Indian marriage, match making, matchmaker, marriage bureau , matchmaking services, matrimonial profiles, matrimony classified, brides, grooms', 'Saraswat Matrimonials', 'Y', 'brahmin-matrimonials.jpg', 'saraswat matrimony');
