INSERT INTO `COMMUNITY_PAGES_MAPPING` VALUES (954, '4', 'CASTE', 'Catholic', '270', 'Catholic - Roman', 'CASTE', 'Y', '/roman-catholic-matrimony-matrimonials', 'L2_CA_954', 'Roman Catholic Church teaches that it was founded by Jesus Christ. Its bishops are successors of his apostles and the Pope as the successor of St. Peter possesses a universal primacy. Well known as the Catholic Church, it consists of 23 autonomous churches â€” one &quot;Western&quot; and 22 &quot;Eastern&quot; â€” governed by two sets of Codes of Canon Law. The term Roman Catholic is used to distinguish different groups of Catholics e.g., those who belong to the Latin Rite from those of the Eastern Catholic Churches.', 'Roman Catholic Matrimony - Roman Catholic Matrimonial - Roman Catholic Matrimonials -Roman Catholic Marriage - Online Roman Catholic Matrimonials - Matrimonial Services', 'Search Roman Catholic Matrimony, Roman Catholic Matrimonial, Roman Catholic Matrimonials, Roman Catholic Marriage, Roman Catholic Matrimonial Profiles in the leading Roman Catholic Matrimonials site for Indian and NRI Roman Catholic Marriage. Join Free &amp; Add your Roman Catholic Matrimonial Profile Now! Find suitable Indian &amp; NRI Roman Catholic brides and grooms from our online Roman Catholic matrimonial and matchmaking services.', 'Roman Catholic matrimony, Roman Catholic matrimonials, Roman Catholic matrimonial, online Roman Catholic matrimonials, Roman Catholic profiles, Roman Catholic matchmaking services, Roman Catholic bride, Roman Catholic groom,  matrimonials, matrimony, matrimony services, Indian marriage, match making, matchmaker, marriage bureau , matchmaking services, matrimonial profiles, matrimony classified, brides, grooms', 'Roman Catholic Matrimonials', 'Y', 'catholic-matrimonials.jpg', 'roman-catholic matrimony');
INSERT INTO `COMMUNITY_PAGES_MAPPING` VALUES (955, '4', 'CASTE', 'Catholic', '268', 'Catholic - Latin', 'CASTE', 'Y', '/catholic-latin-matrimony-matrimonials/', 'L2_CA_955', 'Catholic Christians are the people following the Roman Catholic faith and are the practitioners of western Christianity. Latin Catholics is a sub community of the catholic Christians. Latin Catholics are the people who use Latin as their principle language and also implement the same in their cultural activities and education. There are Latin churches also, which forms a part of the catholic church. Christian Catholic Latins have their origin in Western part of the Europe and North Africa.  ', 'Catholic Latin Matrimony - Catholic Latin Matrimonial - Catholic Latin Matrimonials -Catholic Latin Marriage - Online Catholic Latin Matrimonials - Matrimonial Services', 'Search Catholic Latin Matrimony, Catholic Latin Matrimonial, Catholic Latin Matrimonials, Catholic Latin Marriage, Catholic Latin Matrimonial Profiles in the leading Catholic Latin Matrimonials site for Indian and NRI Catholic Latin Marriage. Join Free &amp; Add your Catholic Latin Matrimonial Profile Now! Find suitable Indian &amp; NRI Catholic Latin brides and grooms from our online Catholic Latin matrimonial and matchmaking services.', 'Catholic Latin matrimony, Catholic Latin matrimonials, Catholic Latin matrimonial, online Catholic Latin matrimonials, Catholic Latin profiles, Catholic Latin matchmaking services, Catholic Latin bride, Catholic Latin groom,  matrimonials, matrimony, matrimony services, Indian marriage, match making, matchmaker, marriage bureau , matchmaking services, matrimonial profiles, matrimony classified, brides, grooms', 'Catholic Latin Matrimonials', 'Y', 'catholic-matrimonials.jpg', 'catholic-latin matrimony');
INSERT INTO `COMMUNITY_PAGES_MAPPING` VALUES (956, '4', 'CASTE', 'Catholic', '267', 'Catholic - Syrian', 'CASTE', 'Y', '/catholic-syrian-matrimony-matrimonials', 'L2_CA_956', 'Syriac or Syrian Christianity comprises multiple Christian traditions of Eastern Christianity. In modern times, it is represented by denominations primarily in the Middle East and in Kerala in India. Services in this tradition tend to feature liturgical (ritualistic) use of ancient Syriac, a dialect related to the Aramaic of Jesus.\nSyriac Christianity, named after ancient Syrians, is divided into two major traditions: East Syrian, centered in Mesopotamia and West Syrian, centered in Antioch. \n', 'Catholic Syrian Matrimony - Catholic Syrian Matrimonial - Catholic Syrian Matrimonials -Catholic Syrian Marriage - Online Catholic Syrian Matrimonials - Matrimonial Services', 'Search Catholic Syrian Matrimony, Catholic Syrian Matrimonial, Catholic Syrian Matrimonials, Catholic Syrian Marriage, Catholic Syrian Matrimonial Profiles in the leading Catholic Syrian Matrimonials site for Indian and NRI Catholic Syrian Marriage. Join Free &amp; Add your Catholic Syrian Matrimonial Profile Now! Find suitable Indian &amp; NRI Catholic Syrian brides and grooms from our online Catholic Syrian matrimonial and matchmaking services.', 'Catholic Syrian matrimony, Catholic Syrian matrimonials, Catholic Syrian matrimonial, online Catholic Syrian matrimonials, Catholic Syrian profiles, Catholic Syrian matchmaking services, Catholic Syrian bride, Catholic Syrian groom,  matrimonials, matrimony, matrimony services, Indian marriage, match making, matchmaker, marriage bureau , matchmaking services, matrimonial profiles, matrimony classified, brides, grooms', 'Catholic Syrian Matrimonials', 'Y', 'catholic-matrimonials.jpg', 'catholic-syrian matrimony');
INSERT INTO `COMMUNITY_PAGES_MAPPING` VALUES (957, '4', 'CASTE', 'Catholic', '269', 'Catholic - Malankara', 'CASTE', 'Y', '/catholic-malankara-matrimony-matrimonials', 'L2_CA_957', 'The Syro-Malankara Catholic Church also known as Malankara Syrian Catholic Church is an Eastern Catholic Church in full communion with the Bishop of Rome (the Pope). It is one of 2 Saint Thomas Christian churches in the Catholic communion, the other being the Syro-Malabar Catholic Church. Syro-Malankara Catholic Church traces its origin to the evangelism of Saint Thomas the Apostle in the 1st century. The Syrian liturgical traditions in its worship were adopted from the Syro- chaldean churches.', 'Catholic Malankara Matrimony - Catholic Malankara Matrimonial - Catholic Malankara Matrimonials -Catholic Malankara Marriage - Online Catholic Malankara Matrimonials - Matrimonial Services', 'Search Catholic Malankara Matrimony, Catholic Malankara Matrimonial, Catholic Malankara Matrimonials, Catholic Malankara Marriage, Catholic Malankara Matrimonial Profiles in the leading Catholic Malankara Matrimonials site for Indian and NRI Catholic Malankara Marriage. Join Free &amp; Add your Catholic Malankara Matrimonial Profile Now! Find suitable Indian &amp; NRI Catholic Malankara brides and grooms from our online Catholic Malankara matrimonial and matchmaking services.', 'Catholic Malankara matrimony, Catholic Malankara matrimonials, Catholic Malankara matrimonial, online Catholic Malankara matrimonials, Catholic Malankara profiles, Catholic Malankara matchmaking services, Catholic Malankara bride, Catholic Malankara groom,  matrimonials, matrimony, matrimony services, Indian marriage, match making, matchmaker, marriage bureau , matchmaking services, matrimonial profiles, matrimony classified, brides, grooms', 'Catholic Malankara Matrimonials', 'Y', 'catholic-matrimonials.jpg', 'catholic-malankara matrimony');
INSERT INTO `COMMUNITY_PAGES_MAPPING` VALUES (958, '4', 'CASTE', 'Catholic', '266', 'Catholic - Knanaya', 'CASTE', 'Y', '/catholic-knanaya-matrimony-matrimonials', 'L2_CA_958', 'The Knanaya people, a subgroup of the Syrian Malabar Nasrani are an ethnoreligious group from Kerala, India. They are of South Indian culture and Syriac Christian faith with some Jewish elements of culture and religion.\n\nKnayanites are divided into 2 groups, first belonging to the Syriac Orthodox Church in India and second to the Syro-Malabar Catholic Church. Knanaya are conscious of their origin and safeguard their ethnic character by marrying people from within the community regardless of rite.\n', 'Catholic Knanaya Matrimony - Catholic Knanaya Matrimonial - Catholic Knanaya Matrimonials -Catholic Knanaya Marriage - Online Catholic Knanaya Matrimonials - Matrimonial Services', 'Search Catholic Knanaya Matrimony, Catholic Knanaya Matrimonial, Catholic Knanaya Matrimonials, Catholic Knanaya Marriage, Catholic Knanaya Matrimonial Profiles in the leading Catholic Knanaya Matrimonials site for Indian and NRI Catholic Knanaya Marriage. Join Free &amp; Add your Catholic Knanaya Matrimonial Profile Now! Find suitable Indian &amp; NRI Catholic Knanaya brides and grooms from our online Catholic Knanaya matrimonial and matchmaking services.', 'Catholic Knanaya matrimony, Catholic Knanaya matrimonials, Catholic Knanaya matrimonial, online Catholic Knanaya matrimonials, Catholic Knanaya profiles, Catholic Knanaya matchmaking services, Catholic Knanaya bride, Catholic Knanaya groom,  matrimonials, matrimony, matrimony services, Indian marriage, match making, matchmaker, marriage bureau , matchmaking services, matrimonial profiles, matrimony classified, brides, grooms', 'Catholic Knanaya Matrimonials', 'Y', 'catholic-matrimonials.jpg', 'catholic-knanaya matrimony');
